INSERT INTO `animes` (`id`, `code`, `name`, `short_name`, `image`, `thumb_image`, `thumb_image_2`, `description`, `episode_count`, `season_count`, `average_min`, `date`, `main_category`, `main_category_name`, `click_count`, `comment_count`, `scoreUsers`, `score`, `showStatus`, `plusEighteen`, `create_user_code`, `update_user_code`, `deleted`, `created_at`, `updated_at`) VALUES
(1, 1, 'Solo Leveling', 'solo-leveling', 'files/animes/animesImages/1.png', 'files/animes/animesImages/thumbnails/1_thumbnail.png', 'files/animes/animesImages/thumbnails/1_thumbnail_2.png', 'On yƒ±l √∂nce \'\'Kapƒ±\'\' ortaya √ßƒ±ktƒ± ve ger√ßek d√ºnya ile b√ºy√º ve canavarlar alemini birbirine baƒüladƒ±. Bu iƒüren√ß yaratƒ±klarla sava≈ümak i√ßin sƒ±radan insanlar insan√ºst√º g√º√ßlere sahip oldular ve \'\'Avcƒ±\'\' olarak tanƒ±ndƒ±lar. Yirmi ya≈üƒ±ndaki Sung Jin-Woo da b√∂yle bir Avcƒ±dƒ±r, ancak E-Rank\'a kƒ±yasla bile acƒ±nasƒ± g√ºc√º nedeniyle \'\'D√ºnyanƒ±n En Zayƒ±fƒ±\'\' olarak bilinmektedir. Yine de annesinin hastane masraflarƒ±nƒ± kar≈üƒ±lamak i√ßin d√º≈ü√ºk r√ºtbeli Gates\'te yorulmadan canavar avlamaktadƒ±r. Ancak bu sefil ya≈üam tarzƒ±, Jin-Woo\'nun -korkun√ß bir ≈üekilde yanlƒ±≈ü giden bir g√∂revde √∂lecek tek ki≈üinin kendisi olduƒüuna inanarak- √º√ß g√ºn sonra bir hastanede uyandƒ±ƒüƒ±nda √∂n√ºnde y√ºzen gizemli bir ekran bulmasƒ±yla deƒüi≈üir. Bu \'\'G√∂rev G√ºnl√ºƒü√º\'\' Jin-Woo\'nun ger√ßek√ßi olmayan ve yoƒüun bir eƒüitim programƒ±nƒ± tamamlamasƒ±nƒ± ya da uygun bir cezaya √ßarptƒ±rƒ±lmasƒ±nƒ± talep etmektedir. G√∂revin zorluƒüundan dolayƒ± ba≈ülangƒ±√ßta buna uymakta isteksiz olan Jin-Woo, √ßok ge√ßmeden bunun kendisini d√ºnyanƒ±n en korkun√ß Avcƒ±larƒ±ndan birine d√∂n√º≈üt√ºrebileceƒüini fark eder.', 0, 0, 22, '2024', 3, 'Doƒüa √ºst√º', 7, 0, 0, 0.00, 0, 0, 0, 0, 0, '2024-02-25 16:13:05', '2024-04-11 06:22:24');
