INSERT INTO `pages` (`id`, `code`, `name`, `short_name`, `text`, `description`, `create_user_code`, `update_user_code`, `deleted`, `created_at`, `updated_at`) VALUES
(1, 1, 'Hakkƒ±mƒ±zda', 'Hakkƒ±mƒ±zda', '<p>&nbsp;Merhabalar, AniKagai olarak size Anime ve Webtoon hizmeti veriyoruz.</p><p>Bu hizmetler sƒ±rasƒ±nda depoladƒ±ƒüƒ±mƒ±z tek bilginiz mail adresleriniz i√ßiniz rahat olsun.</p><p>Amacƒ±mƒ±z sizlere en kaliteli i√ßerikleri en hƒ±zlƒ± ≈üekilde ula≈ütƒ±rabilmek.</p><p>Sitemizde g√∂rd√ºƒü√ºn√ºz sorunlarƒ± veya d√ºzeltilmesi gereken kƒ±sƒ±mlarƒ± bize ileti≈üim kƒ±smƒ±ndan iletebilirsiniz.</p><p>Ekibimize Edit√∂r ya da √áevirmen olarak katƒ±lmak istiyorsanƒ±z bize discord adresimizden yada sitemizin ileti≈üim Kƒ±sƒ±mƒ±ndan ula≈üabilirsiniz.</p><p style=\"\">Reklam, telif haklarƒ±, soru ve √∂neriler ile ilgili konularda \"https://anikagai.com/contact\" adresinden bizimle irtibat kurabilirsiniz.</p><p style=\"\">AniKagai 5651 sayƒ±lƒ± yasanƒ±n 5. maddesinde tanƒ±mlanan yer saƒülayƒ±cƒ± olarak hizmet vermektedir. ƒ∞lgili yasaya g√∂re, web site y√∂netiminin hukuka aykƒ±rƒ± i√ßerikleri kontrol etme y√ºk√ºml√ºl√ºƒü√º yoktur. Bu sebeple, sitemiz uyar ve kaldƒ±r prensibini benimsemi≈ütir. Telif hakkƒ±na konu olan eserlerin yasal olmayan bir bi√ßimde payla≈üƒ±ldƒ±ƒüƒ±nƒ± ve yasal haklarƒ±nƒ±n √ßiƒünendiƒüini d√º≈ü√ºnen hak sahipleri veya meslek birlikleri, \"https://anikagai.com/contact\" mail adresinden bize ula≈üabilirler. Buraya ula≈üan talep ve ≈üikayetler hukuksal olarak incelenecek, ≈üikayet yerinde g√∂r√ºld√ºƒü√º takdirde, ihlal olduƒüu d√º≈ü√ºn√ºlen i√ßerikler sitemizden kaldƒ±rƒ±lacaktƒ±r.</p><p style=\"\">ƒ∞lgili Yasa:</p><p style=\"\">MADDE 5-(1) Yer saƒülayƒ±cƒ±, yer saƒüladƒ±ƒüƒ± i√ßeriƒüi kontrol etmek veya hukuka aykƒ±rƒ± bir faaliyetin s√∂z konusu olup olmadƒ±ƒüƒ±nƒ± ara≈ütƒ±rmakla y√ºk√ºml√º deƒüildir.</p><p style=\"\">(2) Yer saƒülayƒ±cƒ±, yer saƒüladƒ±ƒüƒ± hukuka aykƒ±rƒ± i√ßerikten, ceza sorumluluƒüu ile ilgili h√ºk√ºmler saklƒ± kalmak kaydƒ±yla, bu Kanunun 8 inci ve 9 uncu maddelerine g√∂re haberdar edilmesi halinde ve teknik olarak imk√¢n bulunduƒüu √∂l¬≠√ß√º¬≠de hu¬≠ku¬≠ka aykƒ±rƒ± i√ßeriƒüi yayƒ±ndan kaldƒ±rmakla y√ºk√ºml√ºd√ºr.</p><p style=\"\">English translation:</p>For productions whose copyright belongs to you, the relevant production will be removed from our site within 5 business days as long as you notify us from the \"https://anikagai.com/contact\" section.<br><div class=\"row\" style=\"box-sizing: border-box; display: flex; flex-wrap: wrap; margin-right: -12px; margin-left: -12px; font-family: Rubik, sans-serif; font-size: 13.6px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><div class=\"col-md-12 mb-3\" style=\"box-sizing: border-box; position: relative; width: 1587px; padding-right: 12px; padding-left: 12px; -webkit-box-flex: 0; flex: 0 0 100%; max-width: 100%; margin-bottom: 1rem !important;\"><div class=\"note-editor note-frame card\" style=\"box-sizing: border-box; position: relative; display: flex; -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: column; min-width: 0px; overflow-wrap: break-word; background-clip: border-box; border: 1px solid rgb(169, 169, 169); border-radius: 0.25rem; margin: 0px; box-shadow: none;\"><div class=\"note-statusbar\" role=\"status\" style=\"box-sizing: border-box; background-color: rgb(245, 245, 245); border-top: 1px solid rgb(221, 221, 221); border-bottom-left-radius: 4px; border-bottom-right-radius: 4px;\"><br class=\"Apple-interchange-newline\"></div></div></div></div><p style=\"color: rgb(255, 255, 255); font-family: &quot;proxima nova gremots&quot;, &quot;helvetica neue&quot;, sans-serif; font-size: 14px;\"><br>A√ßƒ±klama:</p><div class=\"row\" style=\"box-sizing: border-box; display: flex; flex-wrap: wrap; margin-right: -12px; margin-left: -12px; color: rgb(80, 93, 105); font-family: Rubik, sans-serif; font-size: 13.6px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><div class=\"col-md-12 mb-3\" style=\"box-sizing: border-box; position: relative; width: 1587px; padding-right: 12px; padding-left: 12px; -webkit-box-flex: 0; flex: 0 0 100%; max-width: 100%; margin-bottom: 1rem !important;\"><div class=\"note-editor note-frame card\" style=\"box-sizing: border-box; position: relative; display: flex; -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: column; min-width: 0px; overflow-wrap: break-word; background-color: rgb(255, 255, 255); background-clip: border-box; border: 1px solid rgb(169, 169, 169); border-radius: 0.25rem; margin: 0px; box-shadow: none;\"><div class=\"note-statusbar\" role=\"status\" style=\"box-sizing: border-box; background-color: rgb(245, 245, 245); border-top: 1px solid rgb(221, 221, 221); border-bottom-left-radius: 4px; border-bottom-right-radius: 4px;\"><div class=\"note-resizebar\" aria-label=\"Resize\" style=\"box-sizing: border-box; padding-top: 1px; height: 9px; width: 1561px; cursor: ns-resize;\"><br class=\"Apple-interchange-newline\"><div class=\"note-icon-bar\" style=\"box-sizing: border-box; width: 20px; margin: 1px auto; border-top: 1px solid rgb(169, 169, 169);\"></div><div class=\"note-icon-bar\" style=\"box-sizing: border-box; width: 20px; margin: 1px auto; border-top: 1px solid rgb(169, 169, 169);\"></div><div class=\"note-icon-bar\" style=\"box-sizing: border-box; width: 20px; margin: 1px auto; border-top: 1px solid rgb(169, 169, 169);\"></div></div></div></div></div></div><p style=\"color: rgb(255, 255, 25