(2, 2, 'Hakkƒ±mƒ±zda', 'Hakkƒ±mƒ±zda', '<p style=\"font-size: 13.6px;\">&nbsp;Merhabalar, AniKagai olarak size Anime ve Webtoon hizmeti veriyoruz.</p><p style=\"font-size: 13.6px;\">Bu hizmetler sƒ±rasƒ±nda depoladƒ±ƒüƒ±mƒ±z tek bilginiz mail adresleriniz i√ßiniz rahat olsun.</p><p style=\"font-size: 13.6px;\">Amacƒ±mƒ±z sizlere en kaliteli i√ßerikleri en hƒ±zlƒ± ≈üekilde ula≈ütƒ±rabilmek.</p><p style=\"font-size: 13.6px;\">Sitemizde g√∂rd√ºƒü√ºn√ºz sorunlarƒ± veya d√ºzeltilmesi gereken kƒ±sƒ±mlarƒ± bize ileti≈üim kƒ±smƒ±ndan iletebilirsiniz.</p><p style=\"font-size: 13.6px;\">Ekibimize Edit√∂r ya da √áevirmen olarak katƒ±lmak istiyorsanƒ±z bize discord adresimizden yada sitemizin ileti≈üim Kƒ±sƒ±mƒ±ndan ula≈üabilirsiniz.</p><p style=\"font-size: 13.6px;\">Reklam, telif haklarƒ±, soru ve √∂neriler ile ilgili konularda \"https://anikagai.com/contact\" adresinden bizimle irtibat kurabilirsiniz.</p><p style=\"font-size: 13.6px;\">AniKagai 5651 sayƒ±lƒ± yasanƒ±n 5. maddesinde tanƒ±mlanan yer saƒülayƒ±cƒ± olarak hizmet vermektedir. ƒ∞lgili yasaya g√∂re, web site y√∂netiminin hukuka aykƒ±rƒ± i√ßerikleri kontrol etme y√ºk√ºml√ºl√ºƒü√º yoktur. Bu sebeple, sitemiz uyar ve kaldƒ±r prensibini benimsemi≈ütir. Telif hakkƒ±na konu olan eserlerin yasal olmayan bir bi√ßimde payla≈üƒ±ldƒ±ƒüƒ±nƒ± ve yasal haklarƒ±nƒ±n √ßiƒünendiƒüini d√º≈ü√ºnen hak sahipleri veya meslek birlikleri, \"https://anikagai.com/contact\" adresinden bize ula≈üabilirler. Buraya ula≈üan talep ve ≈üikayetler hukuksal olarak incelenecek, ≈üikayet yerinde g√∂r√ºld√ºƒü√º takdirde, ihlal olduƒüu d√º≈ü√ºn√ºlen i√ßerikler sitemizden kaldƒ±rƒ±lacaktƒ±r.</p><p style=\"font-size: 13.6px;\">ƒ∞lgili Yasa:</p><p style=\"font-size: 13.6px;\">MADDE 5-(1) Yer saƒülayƒ±cƒ±, yer saƒüladƒ±ƒüƒ± i√ßeriƒüi kontrol etmek veya hukuka aykƒ±rƒ± bir faaliyetin s√∂z konusu olup olmadƒ±ƒüƒ±nƒ± ara≈ütƒ±rmakla y√ºk√ºml√º deƒüildir.</p><p style=\"font-size: 13.6px;\">(2) Yer saƒülayƒ±cƒ±, yer saƒüladƒ±ƒüƒ± hukuka aykƒ±rƒ± i√ßerikten, ceza sorumluluƒüu ile ilgili h√ºk√ºmler saklƒ± kalmak kaydƒ±yla, bu Kanunun 8 inci ve 9 uncu maddelerine g√∂re haberdar edilmesi halinde ve teknik olarak imk√¢n bulunduƒüu √∂l¬≠√ß√º¬≠de hu¬≠ku¬≠ka aykƒ±rƒ± i√ßeriƒüi yayƒ±ndan kaldƒ±rmakla y√ºk√ºml√ºd√ºr.</p><p style=\"font-size: 13.6px;\">English translation:</p><p><span style=\"font-size: 13.6px;\">For productions whose copyright belongs to you, the relevant production will be removed from our site within 5 business days as long as you notify us from the \"https://anikagai.com/contact\" section.</span><br></p>', NULL, 1, 1, 0, '2023-12-30 17:19:37', '2023-12-31 20:30:12'),
