mluluƒüu ile ilgili h√ºk√ºmler saklƒ± kalmak kaydƒ±yla, bu Kanunun 8 inci ve 9 uncu maddelerine g√∂re haberdar edilmesi halinde ve teknik olarak imk√¢n bulunduƒüu √∂l¬≠√ß√º¬≠de hu¬≠ku¬≠ka aykƒ±rƒ± i√ßeriƒüi yayƒ±ndan kaldƒ±rmakla y√ºk√ºml√ºd√ºr.</p><p style=\"font-size: 13.6px;\">English translation:</p><p style=\"font-size: 13.6px;\"><span style=\"font-size: 13.6px;\">For productions whose copyright belongs to you, the relevant production will be removed from our site within 5 business days as long as you notify us from the \"https://anikagai.com/contact\" section.</span></p>', NULL, 1, 1, 1, '2024-03-09 11:08:10', '2024-03-09 11:08:25');
