(20, 20, 'Death Is the Only Ending for the Villainess', 'death-is-the-only-ending-for-the-villainess', 'files/webtoons/webtoonImages/17.jpg', 'files/webtoons/webtoonImages/thumbnails/17_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/17_thumbnail_2.jpg', '-Caninin Tek Sonu √ñl√ºm-   \r\nPenelope Eckart; D√ºk Eckart‚Äòƒ±n evlatlƒ±k kƒ±zƒ± ve harem partner sim√ºlat√∂r√ºn√ºn k√∂t√º karakteri olarak reenkarne oldum. Sorun ≈üu ki, oyuna en zor seviyede girdi ve ne yaparsa yapsƒ±n, her seferinde √∂l√ºmle burun buruna geliyor! D√ºk Eckart‚Äòƒ±n ger√ßek kƒ±zƒ± ortaya √ßƒ±kmadan √∂nce, erkek ana karakterlerden birini se√ßmeli ve hayatta kalmak i√ßin mutlu bir sona ula≈ümalƒ±dƒ±r. Ama bu iki karde≈ü onunla her zaman, en ufak bir ≈üeyde bile kavgaya tutu≈üuyor. Bununla birlikte rotalarƒ± √∂l√ºme yol a√ßan √ßƒ±lgƒ±n bir veliaht prens, di≈üi kur≈üunla b√ºy√ºlenmi≈ü bir sihirbaz ve sadƒ±k bir k√∂le ≈ü√∂valyesi bile var! Ama nasƒ±l oluyorsa, ne zaman √ßizgiyi a≈üsa ana karakterler ile olan a≈ük √∂l√ßeri y√ºkseklik g√∂steriyor! ƒ∞≈üte bu √ßƒ±lgƒ±n bir harem sim√ºlasyonunun i√ßinde tƒ±kalƒ± kalmƒ±≈ü Penelope‚Äòun hikayesi. Death Is the Only Ending for the Villainess', 2, 1, 0, 7, 'Sihir', '2023', 141, 0, 0, 0.00, 0, 0, 0, 0, 0, '2024-02-25 23:43:59', '2024-04-20 15:15:42'),
(21, 21, 'I‚Äôll Be The Matriarch In This Life', 'i-ll-be-the-matriarch-in-this-life', 'files/webtoons/webtoonImages/18.jpg', 'files/webtoons/webtoonImages/thumbnails/18_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/18_thumbnail_2.jpg', 'Florentia, imparatorluƒüun en zengin ailesinin gayri me≈üru √ßocuƒüu olarak yeniden doƒüdu. Gelecekte her ≈üeyin iyi gideceƒüini d√º≈ü√ºnm√º≈üt√º. Ama babasƒ± vefat etmi≈ü, akrabalarƒ± onu kapƒ± e≈üiƒüine bƒ±rakmƒ±≈ü ve gurur duyduƒüu ≈üerefli aile tamamen mahvolmu≈ütur‚Ä¶. Ama bu ger√ßek mi? Biraz (√ßok) i√ßti ve bir araba √ßarptƒ±, Tekrar g√∂zlerini a√ßtƒ±ƒüƒ±nda yedi ya≈üƒ±nda mƒ±ydƒ±? √ústelik √∂nceki hayatƒ±nda ailesinin d√º≈ümanƒ± olan ƒ∞kinci Prens, onu bir k√∂pek gibi takip ediyor! ‚ÄúTia, sen benden daha g√ºzelsin.‚Äù ‚Äú‚Ä¶ .≈ûu anda benimle dalga mƒ± ge√ßiyorsun?‚Äù ‚ÄúHayƒ±r. ƒ∞√ßtenlikle s√∂yledim.‚Äù Pekala, hem ƒ∞kinci Prens hem de aile benim! Bu hayatta, mader≈üahi olmam gerekecek. I‚Äôll Be The Matriarch In This Life', 3, 1, 0, 13, 'Zamanda Yolculuk', '2023', 205, 2, 2, 4.00, 0, 0, 0, 0, 0, '2024-02-25 23:44:30', '2024-04-20 20:22:39'),
(22, 22, 'Why I Quit Being the Demon King', 'why-i-quit-being-the-demon-king', 'files/webtoons/webtoonImages/19.png', 'files/webtoons/webtoonImages/thumbnails/19_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/19_thumbnail_2.png', '-≈ûeytan Kral Olmayƒ± Bƒ±rakma Sebebim-   Kaos zamanlarƒ±nda ≈üeytan kralƒ± insanlar alemini i≈ügal etmeden √∂nce 665 alemi ge√ßti. sava≈üƒ± sonlandƒ±ran cesur bir kahraman vardƒ±. Kutsal fedakarlƒ±klar sayesinde insan ƒ±rkƒ± hayatta kalmayƒ± ba≈üardƒ± ama bu yeni bir ≈üeytan kralƒ±nƒ±n hikayesinin ba≈ülamasƒ±na neden oldu. ≈ûeytan kralƒ±, 666. Demiourgos ile tanƒ±≈üƒ±n! ≈ûeytanlar aleminden gitmeden √∂nce ‚Äú≈ûeytan kralƒ± olmayƒ± bƒ±rakƒ±yorum¬¥¬¥ dedi. Bu ≈üeytanlar aleminden ka√ßan kralƒ±n hikayesi. ≈ûeytan kralƒ± neden kral olmayƒ± bƒ±raktƒ±?', 1, 1, 0, 2, 'Bilim Kurgu', '2024', 214, 0, 1, 5.00, 0, 0, 0, 0, 0, '2024-02-25 23:45:15', '2024-04-21 14:23:55'),
(24, 23, 'The Moonlight Shines On My Fading Future', 'the-moonlight-shines-on-my-fading-future', 'files/webtoons/webtoonImages/23.png', 'files/webtoons/webtoonImages/thumbnails/23_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/23_thumbnail_2.png', 'Bir vikontun kƒ±zƒ± olan Lunatia, ailesi tarafƒ±ndan \"basireti\" i√ßin s√∂m√ºr√ºlen bir ara√ßtan ba≈üka bir ≈üey deƒüildi. Kendi ni≈üanlƒ±sƒ± tarafƒ±ndan bile kullanƒ±lan Lunatia, sonunda yeteneklerinin bedelini bir g√∂z√ºn√º kaybederek √∂der. Kendisini bekleyen tek gelecek, be≈ü duyusunun da kaybolduƒüu bir gelecektir... Kendi ≈üartlarƒ±na g√∂re ya≈üamaya ve onurlu bir √∂l√ºmle √∂lmeye kararlƒ± olan Lunatia evden ka√ßar. Yeni bir gelin aradƒ±ƒüƒ± s√∂ylenen \"Ay Tutulmasƒ± Markisi \"nin malik√¢nesine sƒ±ƒüƒ±nƒ±r. Cesur bir kararlƒ±lƒ±kla, bu korkun√ß ve g√∂r√ºn√º≈üte insanlƒ±k dƒ±≈üƒ± adama evlenme teklif eder: \"Eƒüer beni gelinin yaparsan, g√ºnde bir kez geleceƒüini okuyacaƒüƒ±m. Beni sevmek zorunda deƒüilsin. Ve artƒ±k bana ihtiyacƒ±n kalmadƒ±ƒüƒ±nda, l√ºtfen beni kendi ellerinle √∂ld√ºr.\" B√∂ylece bu alƒ±≈üƒ±lmadƒ±k ≈üartlara dayalƒ± evlilikleri ba≈ülar. Lunatia √∂l√ºmc√ºl hislerini bir sƒ±r olarak saklamaya √ßalƒ±≈üsa da ger√ßekler ortaya √ßƒ±kmaya ba≈ülar. Peki ama s√∂zde ta≈ü kalpli kocasƒ± neden birdenbire beklenmedik derinlikte bir baƒülƒ±lƒ±k g√∂stermeye ba≈ülamƒ±≈ütƒ±r...?', 1, 1, 0, 6, 'Romantizm', '2024', 82, 0, 1, 3.50, 0, 0, 1, 1, 0, '2024-03-09 07:27:20', '2024-04-20 20:22:39'),
(25, 24, 'Leveling Up My Isekai‚Äôd Abs', 'leveling-up-my-isekai-d-abs', 'files/webtoons/webtoonImages/24.png', 'files/webtoons/webtoonImages/thumbnails/24_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/24_thumbnail_2.png', 'Sung Suwoo her ≈üeye sahip - yakƒ±≈üƒ±klƒ±, g√º√ßl√º ve pop√ºler. Tek sorunu, ne kadar antrenman yaparsa yapsƒ±n karƒ±n kaslarƒ±nƒ± geli≈ütirememesi! Sarkƒ±k bir karnƒ± olduƒüu i√ßin kƒ±z arkada≈üƒ± tarafƒ±ndan terk edildikten sonra, bir webcomic evreninde tekrar doƒüar! Eve d√∂nmek i√ßin tek bileti S-rank karƒ±n kaslarƒ±na sahip romantik t√ºr√ºn en ate≈üli erkek karakteri olmaksa, ba≈üarƒ±lƒ± bir ≈üekilde geri d√∂nebilecek mi?', 2, 1, 0, 2, 'Bilim Kurgu', '2024', 138, 3, 1, 3.00, 0, 0, 1, NULL, 0, '2024-03-09 09:20:58', '2024-04-20 20:22:39'),
(26, 25, 'Don‚Äôt Be Carelessly Friendly', 'don-t-be-carelessly-friendly', 'files/webtoons/webtoonImages/25.png', 'files/webtoons/webtoonImages/thumbnails/25_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/25_thumbnail_2.png', 'Y√ºzyƒ±llar boyunca Caleta ƒ∞mparatorluƒüu\'nun dahi ≈ü√∂valyesi olarak √ºnlenen, \'Bariyer\' ve bitmek bilmeyen sava≈ülarla m√ºcadele eden \'Lustica Zenas\', sanki bir yalanmƒ±≈ü gibi t√ºm g√ºc√ºn√ºn bir gecede yok olduƒüunu g√∂rd√º.\r\n\r\nD√∂rt yƒ±llƒ±k inzivanƒ±n ardƒ±ndan, tatlƒ± bir gece ge√ßirdiƒüi \'Hayden\' adƒ±nda gizemli bir adam kar≈üƒ±sƒ±na √ßƒ±kar, ancak ger√ßek kimliƒüi bilinmemektedir. Hayden, Lustica\'nƒ±n ge√ßmi≈üini hatƒ±rlƒ±yor gibidir.\r\n\r\nBu arada Caleta ƒ∞mparatoru, artƒ±k bir fakir gibi ya≈üayan Lustica\'yƒ± √ßaƒüƒ±rƒ±r ve onu diplomat olarak yƒ±kƒ±lmakta olan bariyerin √∂tesindeki ezeli d√º≈ümanƒ± Perseta ƒ∞mparatorluƒüu\'na g√∂nderir.\r\n\r\nT√ºm g√ºc√ºn√º kaybetmi≈ü olan eski ≈ü√∂valye Lustica, ge√ßmi≈üteki benliƒüini geri kazanabilecek midir?', 1, 1, 0, 6, 'Romantizm', '2024', 80, 1, 1, 5.00, 0, 0, 1, NULL, 0, '2024-03-14 12:24:38', '2024-04-20 20:22:38'),
(27, 26, 'Hand Over The Money!', 'hand-over-the-money-', 'files/webtoons/webtoonImages/26.png', 'files/webtoons/webtoonImages/thumbnails/26_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/26_thumbnail_2.png', 'Hand Over The Money\r\n√ñzel kuvvetlerden zorla atƒ±ldƒ±ktan sonra normal bir ofis √ßalƒ±≈üanƒ± hayatƒ± ya≈üayan Ju Hyuk, bir g√ºn g√∂zl√ºkleri aracƒ±lƒ±ƒüƒ±yla ani ve garip g√∂revler alƒ±r.\r\nEn iyisini umarak g√∂revleri yerine getirirken‚Ä¶ Parasƒ± deli gibi √ßoƒüalmaya ba≈ülar‚Ä¶?!!!\r\nParanƒ±n tadƒ±nƒ± aldƒ±ktan sonra, Ju Hyuk ciddi bir ≈üekilde para kazanmak i√ßin hayatta kalma oyunlarƒ±na katƒ±lmaya ba≈ülar ve ezici fiziƒüi sayesinde diƒüer t√ºm katƒ±lƒ±mcƒ±larƒ± ezip ge√ßen bir m√ºdavim haline gelir!!!', 1, 1, 0, 12, 'Sistem', '2024', 88, 3, 2, 2.25, 0, 0, 1, NULL, 0, '2024-03-17 12:21:25', '2024-04-20 20:22:38');
